import React from 'react';
import { NavLink } from 'react-router-dom';

const SignedInLinks = () => {
    return (
        <ul classname="right">
            <li><NavLink to="/" classname="btn btn-floating pink lighten-1">LinkLoggeado1</NavLink></li>
        </ul>
    )
}

export default SignedInLinks;
